// Configuración de navegación para el portafolio
const navigationConfig = [
  {
    id: 'home',
    label: {
      es: 'Inicio',
      en: 'Home'
    },
    path: '#home'
  },
  {
    id: 'about',
    label: {
      es: 'Sobre Mí',
      en: 'About Me'
    },
    path: '#about'
  },
  {
    id: 'skills',
    label: {
      es: 'Habilidades',
      en: 'Skills'
    },
    path: '#skills'
  },
  {
    id: 'projects',
    label: {
      es: 'Proyectos',
      en: 'Projects'
    },
    path: '#projects'
  }
];

export default navigationConfig;
